import Card from "../Card/Card";
import { useSelector } from "react-redux";

const CardsCont = () => {

    const friends = useSelector(state=> state.users);

    
    return (
        <div>
            { friends.map( frien => {
                return <Card
                nombre={frien.name}
                />
            })}
        </div>
    )
}

export default CardsCont;
